// SPDX-License-Identifier: MIT
pragma solidity ^0.8.15;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "./VerifySignature.sol";
import "./Whitelist.sol";
import "./INagaKidsNFT.sol";

contract MintNagaKids is Whitelist, VerifySignature, AccessControl, ReentrancyGuard {

    INagaKidsNFT public nagaKidsContract;
    bool public isPublicOpen;
    bool public isWhitelistOpen;

    address public signer;

    mapping(address => bool) _isWhitelistMinted;
    mapping(address => uint256) _isWhitelistMintedAmount;
    mapping(address => bool) _isPublicMinted;
    mapping(address => uint256) _isPublicMintedAmount;

    event WhitelistMinted(address user,uint256 amount);

    constructor(INagaKidsNFT _nagaKids,bytes32 _merkleRoot) {

        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        setNagaKidsContract(_nagaKids);
        setMerkleRoot(_merkleRoot);

    }

    modifier Paused() {
        require(isPause() == false,"NagaKids was Paused.");
        _;
    }

    function setNagaKidsContract(INagaKidsNFT _nagaKids) public onlyRole(DEFAULT_ADMIN_ROLE) {
        nagaKidsContract = _nagaKids;
    }
    
    function setSigner(address _signer) public onlyRole(DEFAULT_ADMIN_ROLE) {
        signer = _signer;
    } 

    function setWhitelistMintOpen(bool _isOpen) public onlyRole(DEFAULT_ADMIN_ROLE) {
        isWhitelistOpen = _isOpen;
    }

    function setPublicOpen(bool _isOpen) public onlyRole(DEFAULT_ADMIN_ROLE) {
        isPublicOpen = _isOpen;
    }
    
    function setMerkleRoot(bytes32 _merkleRoot) public onlyRole(DEFAULT_ADMIN_ROLE) {
        merkleRoot = _merkleRoot;
    }


    function whitelistMint(bytes32[] calldata _proofMerkle,uint256 _amount) public payable nonReentrant Paused {
        require(isWhitelistOpen == true, "Whitelist not open to mint.");
        require(getTotalSupply() + _amount < 1111, "Over supply");
        require(isWhitelistMinted(msg.sender) != true, "You are already minted.");
        require(nagaKidsContract.hasRole(nagaKidsContract.MINTER_ROLE(),address(this)) == true,"This Contract not have permission to mint.");
        require(isWhitelist(_proofMerkle,msg.sender,_amount), "Unauthorized Whitelist This User.");

        _isWhitelistMinted[msg.sender] = true;
        _isWhitelistMintedAmount[msg.sender] += _amount;

        for(uint i = 0; i< _amount; i++){
            nagaKidsContract.safeMint(msg.sender);
        }

        emit WhitelistMinted(msg.sender,_amount);
    }

    function publicMint(bytes calldata _sig) public payable nonReentrant Paused {

        require(isPublicOpen == true, "Whitelist not open to mint.");
        require(isPublicMinted(msg.sender) != true, "You are already minted.");
        require(getTotalSupply() + 1 < 1111,"Over Supply Amount");
        require(nagaKidsContract.hasRole(nagaKidsContract.MINTER_ROLE(),address(this)) == true,"This Contract not have permission to mint.");
        require(verify(signer,msg.sender,_sig));
    }

    function isWhitelistMinted(address _user) public view returns(bool) {
        return _isWhitelistMinted[_user];
    }

    function isWhitelistMintedAmount(address _user) public view returns(uint256) {
        return _isWhitelistMintedAmount[_user];
    }

    function isPublicMinted(address _user) public view returns(bool) {
        return _isPublicMinted[_user];
    }

    function isPublicMintedAmount(address _user) public view returns(uint256) {
        return _isPublicMintedAmount[_user];
    }


    function getTotalSupply() public view returns (uint256) {
        return nagaKidsContract.totalSupply();
    }

    function getMaxSupply() public view returns (uint256) {
        return nagaKidsContract.maxSupply();
    }

    function isPause() public view returns (bool) {
        return nagaKidsContract.paused();
    }
}

